import React from "react";
import Form from "./login"
import Input from "./input";

function App() {
  return (
    <div className="container">
      <h1>Hello</h1>
      <Form>
        <Input type="text" holder="Username" />
        <Input type="password" holder="Password" />
        <button type="submit">Login</button>
      </Form>
    </div>
  );
}

export default App;
